#!/bin/bash _XTRACE_OVS_DPDK_CTL=$(set +o | grep xtrace) if [[ "${OVS_DPDK_CTL_DEBUG}" == "True" ]]; then set -o xtrace fi CONFIG_FILE=${CONFIG_FILE:-"/etc/default/ovs-dpdk.conf"} function get_value { crudini --get $CONFIG_FILE $@ } function set_value { crudini --set $CONFIG_FILE $1 $2 "$3" } function del_value { crudini --del $CONFIG_FILE $@ } function is_set { output=$(crudini --get $CONFIG_FILE $* &> /dev/null ) && [ -n "$(crudini --get $CONFIG_FILE $*)" ]; echo $? } function show_config { cat $CONFIG_FILE } function get_config { echo $CONFIG_FILE } function del_config { rm -f $CONFIG_FILE } function generate_pciwhitelist { local _Whitelist='' for nic in $(list_dpdk_nics); do address="$(get_value $nic address)" if [ "$_Whitelist" == '' ]; then _Whitelist="-w $address" else _Whitelist="$_Whitelist -w $address" fi done echo $_Whitelist } function gen_port_mappings { OVS_BRIDGE_MAPPINGS=$(get_value ovs bridge_mappings) OVS_BRIDGES=${OVS_BRIDGE_MAPPINGS//,/ } OVS_DPDK_PORT_MAPPINGS="" ARRAY=( $OVS_BRIDGES ) for net in "${ARRAY[@]}"; do bridge="${net##*:}" nic=${bridge/br-/} if [[ -z "$OVS_DPDK_PORT_MAPPINGS" ]]; then OVS_DPDK_PORT_MAPPINGS="$nic:$bridge" else OVS_DPDK_PORT_MAPPINGS="$OVS_DPDK_PORT_MAPPINGS,$nic:$bridge" fi done echo "$OVS_DPDK_PORT_MAPPINGS" } function gen_config { del_config touch $CONFIG_FILE set_value ovs bridge_mappings ${bridge_mappings:-""} set_value ovs port_mappings ${port_mappings:-$(gen_port_mappings)} set_value ovs cidr_mappings ${cidr_mappings:-""} set_value ovs pmd_coremask ${pmd_coremask:-"0x2"} set_value ovs ovs_mem_channels ${ovs_mem_channels:-4} set_value ovs ovs_socket_mem ${ovs_socket_mem:-"512"} set_value ovs dpdk_interface_driver ${dpdk_interface_driver:-"uio_pci_generic"} set_value ovs hugepage_mountpoint ${hugepage_mountpoint:-"/dev/hugepages"} ls -al /sys/class/net/* | awk '$0 ~ /pci/ {n=split($NF,a,"/"); print "
[" a[n] "]
address = " a[n-2] "
driver ="}' >> $CONFIG_FILE for nic in $(get_value | grep -v ovs); do set_value $nic driver $(get_driver_by_address $(get_value $nic address)) done for nic in $(list_dpdk_nics); do set_value $nic driver ${dpdk_interface_driver:-"uio_pci_generic"} done set_value ovs pci_whitelist "'${pci_whitelist:-$(generate_pciwhitelist)}'" } function unbind_nic { echo $1 > /sys/bus/pci/drivers/$2/unbind echo > /sys/bus/pci/devices/$1/driver_override } function bind_nic { echo $1 > /sys/bus/pci/drivers/$2/bind echo $2 > /sys/bus/pci/devices/$1/driver_override } function bind_nics { for nic in $(list_dpdk_nics); do device_address="$(get_value $nic address)" current_driver="$(get_driver_by_address $device_address)" target_driver="$(get_value $nic driver)" if [ "$current_driver" != "$target_driver" ]; then set_value $nic old_driver $current_driver unbind_nic $device_address $current_driver bind_nic $device_address $target_driver fi done } function unbind_nics { for nic in $(list_dpdk_nics); do if [ "$(is_set $nic old_driver)" == 0 ]; then device_address="$(get_value $nic address)" current_driver="$(get_driver_by_address $device_address)" target_driver="$(get_value $nic old_driver)" if [ "$current_driver" != "$target_driver" ]; then unbind_nic $device_address $current_driver bind_nic $device_address $target_driver del_value $nic old_driver fi fi done } function list_dpdk_nics { for nic in $(crudini --get $CONFIG_FILE ovs port_mappings | cut -d : -f 1); do echo $nic; done } function get_address_by_name { ls -al /sys/class/net/$1 | awk '$0 ~ /pci/ {n=split($NF,a,"/"); print a[n-2] }' } function get_driver_by_address { ls /sys/bus/pci/devices/$1/driver -al | awk '{n=split($NF,a,"/"); print a[n]}' } function useage { echo "TODO add useage info" echo "Usage: $0 {start|stop|restart|status|init}" echo "A tool to control binding of dpdk nic and" echo "configuration of ovs with dpdk" } if [ $# -ge 1 ]; then func=$1 shift else func="useage" fi #replace with switch later eval "$func $@" ${_XTRACE_OVS_DPDK_CTL}
